response.about:
Всем привет!

В первом посте принято знакомиться. Давайте, так и сделаем 😊

Меня зовут Надежда Акулова, я психолог.

Темы, с которыми работаю:

Отношения в паре: 
🔹 не складывается личная жизнь;
🔹 пережить расставание;
🔹 неудовлетворенность отношениями;
🔹 утрата себя в отношениях, всюду подстраиваетесь под партнёра и ничего не можете с этим сделать.

Отношение к себе, самооценка:
🔹 умение находить поддержку и обеспечивать себя поддержкой самостоятельно;
🔹 уверенность в себе и ее отсутствие;
🔹 трудности в принятии решений;
🔹 у вас есть темы, которые вы не можете обсудить с другими людьми. 

Изменения в жизни:
🔹 неудовлетворенность какими-либо сферами жизни;
🔹 жить по-старому больше не хочется, а как по-новому непонятно;
🔹 не знаете, чего хотите;
🔹 кажется, что ходите по кругу;
🔹 смысл жизни, самореализации, запросы о том, как жить "здесь и сейчас" и "что делать";
🔹 изменение жизненных сценариев - например, трансформация семейных сценариев (пришедших из родительской семьи), установок и т.д. 

Я знакома с различными направлениями в психологии, поэтому исходя из вашего запроса мы с вами будем подбирать наиболее подходящий для вас подход.

Училась в Институте Консультирования (г.Новосибирск). Прошла обучение в Национальной Академии Дополнительного Профессионального Образования (г.Москва), Институте современной психотерапии и психологии (Новосибирск) Сейчас учусь в Московском Институте гештальта и психодрамы. Имею диплом о профессиональном образовании, а так же постоянно прохожу курсы повышения квалификации.

На сегодняшний момент сама прошла больше 1000 часов личной и групповой терапии.

✅ Организационные моменты:

- Работаю с психически здоровыми людьми;
- Формат: Skype, WhatsApp, Телеграм, Zoom;

- Стоимость:
60 мин - 2000р.
------------------------------------
Молодежный прайс:

60 мин - 1500р. (очно, онлайн)

В категорию молодежного прайса попадают люди 18-21 лет включительно.
------------------------------------

- Частота: в зависимости от вашего запроса;
- Время встреч: обговариваем индивидуально;
- Основные правила: анонимность и конфиденциальность (гарантирую неразглашение личной информации и сохранение тайны личности клиента), добровольность (мы пойдем так глубоко, насколько вы будете готовы) и безопасность.
- Прохожу супервизию у опытных коллег (это значит, что профессионально расту под присмотром наставников).

⛔ НЕ работаю: с близкими друзьями и их родственниками, с детьми, с парами, а также с клиентами в тяжелом состоянии и отдельными сложными случаями. При таких обстоятельствах могу порекомендовать другого специалиста.

Чтобы записаться на личную консультацию, пишите в личные сообщения.
